<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <title>Page Not Found</title>
    <meta http-equiv="refresh" content="0; url=%PUBLIC_URL%/" />
    <script>
      // Client-side redirect to support SPA deep links on GitHub Pages
      (function () {
        var redirectTo = '%PUBLIC_URL%/' + (window.location.pathname || '').replace(/^\//, '');
        window.location.replace(redirectTo);
      })();
    </script>
  </head>
  <body></body>
  </html>
